import React from 'react';
import './../styles/footer.scss';

export default function Footer() {
    return (
        <div className="footercontainer">
            <div className="footer">
                <div className="footer-column">
                    designed by <span className="author">marissa wong</span> &copy; 2020
                </div>
                <div className="footer-column">
                    <a href="/github"><i class="fa fa-github" /></a>
                    <a href="/facebook"><i class="fa fa-facebook-square"/></a>
                    <a href="/instagram"><i class="fab fa-instagram"/></a>
                    <a href="/dev"><i class="fab fa-dev"/></a>
                </div>
            </div>
        </div>
    )
}
